import React from 'react';

import './css/About.css';
import Services from './Services';
import Separater from './Separater';

class About extends React.Component {


  render () {
    return (
      <div className='Section'>
        <p>
          <strong className='Titles AboutMe'>about me</strong>
        </p>
        <p>
          <i>
          <span className='Highligh-Green-Text'>24 let</span>
          <span className='Seperater-Title'>/</span>
          <span className='Highligh-Green-Text'>Břežany II</span>
          <span className='Seperater-Title'>/</span>
          <span className='Highligh-Green-Text'>Freelancer</span>
          </i>
        </p>
        <p className='About-Text Paragraf'>
        Klidný, nevyžaduji pozornost, protože mám rád svůj klid a prostor bych se mohl soustředit na práci, označil bych se poloviční introvert. Snažím se aby moje práce byla vždy kvalitní a pečlivá, i když za danou myšlenou není velká věda tak stále se snažím aby to působilo co možná nejlépe na pohled. Věřím, že imige mojí práce je to první, co zapůsobí. 
        </p>
        <p className='Paragraf'>
        Zároveň svůj klid a prostor dokáže vyměnit za sportování a dobrodružství. Mám rád luxus , styl co se týče oblékání a dobrý čaj nebo kávu.
        </p>
        <Separater />
        <Services />
      </div>
    );
  }
}

export default About;
